# 5) UI STREAMLIT
# ======================================================================
header("🚀 Calculadora de PCI (RDF)", "H.Vladimir M: hadervm@gmail.com Retirar SAS ESP Unidad I+D+i")

with st.sidebar:
    st.header("⚙️ Parámetros de Entrada")
    n = st.slider(
        "Número de corrientes de residuos",
        min_value=1,
        max_value=len(MATERIALES),
        value=3,
        help="Cantidad de materiales diferentes en la mezcla",
    )
    st.markdown("---")
    st.info("Selecciona el material y su cantidad en kg para cada corriente.")

# Tabla de referencia
df_ref = pd.DataFrame([(k, v[0], v[1]) for k, v in MATERIALES.items()],
                      columns=["ID", "Material", "PCI (kcal/kg)"])
st.subheader("📚 Tabla de referencia (Materiales y PCI)")
st.dataframe(df_ref, hide_index=True, use_container_width=True)

# Entradas
st.subheader("🧮 Formulación de la mezcla")
cols = st.columns(2)
inputs = []
for i in range(n):
    with cols[i % 2]:
        st.markdown(f"#### Material {i+1}")
        residuo_id = st.selectbox(
            f"ID del material {i+1}",
            options=list(MATERIALES.keys()),
            index=i if i < len(MATERIALES) else 0,
            format_func=lambda x: f"{x} - {MATERIALES[x][0]}",
            key=f"id_{i}",
        )
        cantidad = st.number_input(
            f"Cantidad (kg) {i+1}",
            min_value=0.0,
            value=0.0,
            step=0.5,
            key=f"cant_{i}",
        )
        inputs.append((residuo_id, cantidad))

# Botón calcular
if st.button("⚡ Calcular PCI", type="primary", use_container_width=True):
    df_mix, pci_pond, total_kg = calcular_mezcla(inputs)

    if total_kg <= 0:
        st.error("❌ La masa total debe ser mayor que 0 kg.")
        st.stop()

    st.success("✅ Cálculo completado")

    # Métricas principales
    m1, m2, m3 = st.columns(3)
    with m1:
        st.metric("Masa Total", f"{total_kg:,.2f} kg")
    with m2:
        st.metric("PCI de Mezcla", f"{pci_pond:,.2f} kcal/kg")
    with m3:
        estado = "🟢 Apto" if pci_pond >= UMBRAL_PCI else "🔴 No Apto"
        st.metric("Estado CDR", estado)

    # Tabla de mezcla
    st.subheader("📋 Detalle de la mezcla")
    st.dataframe(df_mix, hide_index=True, use_container_width=True)

    # Gráfico de composición
    st.subheader("📈 Composición (% en peso)")
    if (df_mix["Cantidad (kg)"] > 0).any():
        fig = px.pie(
            df_mix,
            names="Material",
            values="Cantidad (kg)",
            hole=0.4,
            title=f"Distribución de Materiales (PCI: {pci_pond:,.2f} kcal/kg)",
        )
        fig.update_layout(margin=dict(t=40, b=10))
        st.plotly_chart(fig, use_container_width=True)
    else:
        st.info("Introduce cantidades > 0 para ver el gráfico.")

    # Módulo de sustentabilidad
    st.subheader("🌱 Sustentabilidad")
    if pci_pond >= UMBRAL_PCI:
        co2_evitado = (total_kg / 1000.0) * FE_TOTAL  # ton CO2eq
        arboles = (co2_evitado * 1000.0) / (KG_CO2_POR_ARBOL_ANUAL * ANOS_ABSORCION)
        c1, c2 = st.columns(2)
        with c1:
            st.metric("CO₂ evitado", f"{co2_evitado:,.2f} ton")
        with c2:
            st.metric("Equivalente en árboles", f"{int(arboles):,} árboles")
        st.caption(
            f"Supuestos: {FACTOR_DESPLAZAMIENTO} t-CO₂eq/t + {FACTOR_DISPOSICION} t-CO₂eq/t = {FE_TOTAL} t-CO₂eq/t. "
            f"Cada árbol absorbe {KG_CO2_POR_ARBOL_ANUAL} kg/año durante {ANOS_ABSORCION} años."
        )
    else:
        st.warning(
            f"La mezcla no alcanza el umbral de {UMBRAL_PCI:,} kcal/kg. "
            "Prueba aumentando materiales de alto PCI (plásticos/cauchos) o reduciendo los de bajo PCI."
        )

